/*

  Creates a dropzone for uploading imgur files and inserting the GIF created url into a given result field.

  $('.uploader').uploader({
    urlResultField : $('input[name=gif_remote_url]')
  });

*/

(function( $ ){
  $.fn.uploader = function( options ) {
    if ( options ) {
       var urlResultField = $(options.urlResultField);
    }

    /* Setup class to indicate dropability of file */
    /* Upload a file on drop */
    $(this).on('dragover dragenter', function(e) {
      e.preventDefault();
      urlResultField.addClass("dragover");
    })
    .on('dragleave dragend', function(e) {
      e.preventDefault();
      urlResultField.removeClass("dragover");
    })
    .on('drop', function(e) {
       e.preventDefault();
       upload(e.originalEvent.dataTransfer.files[0]);
       urlResultField.removeClass("dragover");
    });


    // Source: https://hacks.mozilla.org/2011/03/the-shortest-image-uploader-ever/
    // Additional: https://hacks.mozilla.org/2011/01/how-to-develop-a-html5-image-uploader/
    function upload(file) {
        /* Is the file an image? */
        if (!file || !file.type.match(/image.*/) || !file.name.match(/\.gif/)) return;
        /* Mark uploading here */
        urlResultField.val("Uploading to imgur, please wait...")
        urlResultField.prop("readonly", true);
        /* Lets build a FormData object*/
        var fd = new FormData();
        fd.append("image", file); // Append the file
        var xhr = new XMLHttpRequest(); // Create the XHR (Cross-Domain XHR)
        xhr.open("POST", "https://api.imgur.com/3/image.json"); // Post the image directly to imgur
        xhr.onload = function() {
            if (urlResultField != null) {
              var file = JSON.parse(xhr.responseText).data;
              urlResultField.val(file.gifv || file.link);
              urlResultField.prop("readonly", false);
              urlResultField.trigger('input');
            }
        }
        // Setup authorization at https://api.imgur.com/oauth2/addclient
        xhr.setRequestHeader('Authorization', 'Client-ID 5107387096c483e');
        // Ok, I don't handle the errors. An exercise for the reader.
        /* And now, we send the formdata */
        xhr.send(fd);
    }
  };
})(window.jQuery);

